import React from "react";
import {PropTypes} from "prop-types";

import Tag from "./Tag";

const DATA = "data:image/webp;base64,";

function UR({className}) {
  return (
    <Tag data={DATA} className={className}/>
  );
}

UR.propTypes = {
  className: PropTypes.string,
};

UR.defaultProps = {
  className: "",
};

export default UR
